import React, { Component } from 'react';
import './App.css';

class Rat extends Component {
  state = { 
            livePic: "one.jpg", 
            images: ["https://img.huffingtonpost.com/asset/596fbe732100003700fc7c1c.jpeg?cache\u003d2vygggifqj\u0026ops\u003dscalefit_720_noupscale", "data:image/jpeg;base64,", "https://i.pinimg.com/originals/79/d5/10/79d5109ab903ddcb5e98f548c522f411.png", "http://tsitaty.org/wp-content/uploads/2018/12/cropped-kryska-kniga-kofe-kruzhechka-nochnoe-chtenie.jpg", "http://rsute.ru/upkeep/uploads/2019/10/ASD4-fkujBH7-JU_5-4r83-h6wgFD_5-7HNH-God-metallicheskoj-krysy.jpg8_.jpg", "https://i.pinimg.com/originals/08/1d/41/081d41ba23b574ce433ba9858e37a914.jpg", 
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,", "https://i.pinimg.com/originals/0a/45/fb/0a45fbec155897653b7e8d41a7c9e45e.jpg",
            "data:image/jpeg;base64,"],
            index: 0
          };


  componentDidMount(){
    this.setState({
      livePic: this.state.images[this.state.index]
    });
  }
  newPic = () => {
      var newIndex = Math.floor(Math.random() * (this.state.images.length -1));

      if (newIndex === this.state.images.length - 1){
        newIndex = 0;
      }

      console.log(newIndex);
      this.setState({ 
        livePic: this.state.images[newIndex],
        index: newIndex
      })
  };
  render() { 
  return(
      <main>
          <div>
          <h1>React to these rats</h1>
          <button onClick={this.newPic}>New Rat Picture</button>
          <br/>
          <br/>
          <img src={this.state.livePic} width="500px" />
          </div>
      </main>
    );
  }
}
 
export default Rat;